/**
 * @param {number} low
 * @param {number} high
 * @param {number} k
 * @return {number}
 */
var numberOfBeautifulIntegers = function(low, high, k) {
    let count = 0;

    function isBeautiful(number) {
        let even = 0, odd = 0;
        while (number) {
            let digit = number % 10;
            number = Math.floor(number / 10);
            digit % 2 === 0 ? even++ : odd++;
        }
        return even === odd;
    }

    if (k === 1) {
        for (let num = Math.max(low, 10); num <= high; num++) {
            if (isBeautiful(num)) count++;
        }
    } else {
        for (let num = low; num <= high; num++) {
            if (num % k === 0 && isBeautiful(num)) count++;
        }
    }

    return count;
};
